defs/html/vue_html._.attribute.v-else-if.example:
Represents the "else if block" of v-if. Can be chained.
<pre>
&lt;div v-if=&quot;type === &#x27;A&#x27;&quot;&gt;
  A
&lt;/div&gt;
&lt;div v-else-if=&quot;type === &#x27;B&#x27;&quot;&gt;
  B
&lt;/div&gt;
&lt;div v-else-if=&quot;type === &#x27;C&#x27;&quot;&gt;
  C
&lt;/div&gt;
&lt;div v-else&gt;
  Not A/B/C
&lt;/div&gt;
</pre>

defs/html/vue_html._.attribute.v-else.example:
Add "else block" to v-if or v-else-if. 
<pre>
&lt;div v-if=&quot;Math.random() &gt; 0.5&quot;&gt;
  Now you see me
&lt;/div&gt;
&lt;div v-else&gt;
  Now you don&#x27;t
&lt;/div&gt;
</pre>

defs/html/vue_html._.attribute.v-for.example:
alias in expression ，Provide aliases for the currently traversed elements:
<pre>
&lt;div v-for=&quot;item in items&quot;&gt;
  {{ item.text }}
&lt;/div&gt;
</pre>
You can also specify aliases (or keys for objects) for array indexes:
<pre>
&lt;div v-for=&quot;(item, index) in items&quot;&gt;&lt;/div&gt;
&lt;div v-for=&quot;(val, key) in object&quot;&gt;&lt;/div&gt;
&lt;div v-for=&quot;(val, key, index) in object&quot;&gt;&lt;/div&gt;
</pre>
v-for The default behavior tries not to change the whole, but to replace the elements. For the elements to be reordered, you need to provide a special attribute of key:
<pre>
&lt;div v-for=&quot;item in items&quot; :key=&quot;item.id&quot;&gt;
  {{ item.text }}
&lt;/div&gt;
</pre>

defs/js/vue.2.x.Class<Vue>_.method.$emit.example:
$emit：
<pre>
Vue.component('welcome-button', {
  template: `
    <button v-on:click="$emit('welcome')">
      Click me to be welcomed
    </button>
  `
})
</pre>
<pre>
&lt;div id="emit-example-simple"&gt;
  &lt;welcome-button v-on:welcome="sayHi"&gt;&lt;/welcome-button&gt;
&lt;/div&gt;
</pre>
<pre>
new Vue({
  el: '#emit-example-simple',
  methods: {
    sayHi: function () {
      alert('Hi!')
    }
  }
})
</pre>
